<!DOCTYPE html>

<head>

<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">

<link rel="stylesheet" id="dashicons-css" href="http://mysitefortest.xyz/wp-includes/css/dashicons.min.css?ver=5.8" type="text/css" media="all">
<link rel="stylesheet" id="buttons-css" href="http://mysitefortest.xyz/wp-includes/css/buttons.min.css?ver=5.8" type="text/css" media="all">
<link rel="stylesheet" id="forms-css" href="http://mysitefortest.xyz/wp-admin/css/forms.min.css?ver=5.8" type="text/css" media="all">
<link rel="stylesheet" id="l10n-css" href="http://mysitefortest.xyz/wp-admin/css/l10n.min.css?ver=5.8" type="text/css" media="all">
<link rel="stylesheet" id="login-css" href="http://mysitefortest.xyz/wp-admin/css/login.min.css?ver=5.8" type="text/css" media="all">

<style media="screen">
#login_error, .login .message, #loginform { margin-bottom: 20px; }
</style>

<link rel="icon" href="http://mysitefortest.xyz/wp-content/uploads/2019/11/favicon.png" sizes="32x32">
<link rel="icon" href="http://mysitefortest.xyz/wp-content/uploads/2019/11/favicon.png" sizes="192x192">
<link rel="apple-touch-icon" href="http://mysitefortest.xyz/wp-content/uploads/2019/11/favicon.png">
<meta name="msapplication-TileImage" content="http://mysitefortest.xyz/wp-content/uploads/2019/11/favicon.png">
<meta name="robots" content="noindex,follow">
		<meta name="viewport" content="width=device-width">
		
</head>
<body class="login login-password-protected login-action-password-protected-login wp-core-ui">

<div id="login">
	<h1><a href="http://mysitefortest.xyz/" title="My Site For Test">My Site For Test</a></h1>

		
	<form name="loginform" id="loginform" action="http://mysitefortest.xyz/?password-protected=login" method="post">
		<p>
			<label for="password_protected_pass">Password<br>
			<input type="password" name="password_protected_pwd" id="password_protected_pass" class="input" value="" size="20" tabindex="20"></label>
		</p>

		
		<p class="submit">
			<input type="submit" name="wp-submit" id="wp-submit" class="button button-primary button-large" value="Log In" tabindex="100">
			<input type="hidden" name="password_protected_cookie_test" value="1">
			<input type="hidden" name="password-protected" value="login">
			<input type="hidden" name="redirect_to" value="http://mysitefortest.xyz/">
		</p>
	</form>

	
</div>

<script>
try{document.getElementById('password_protected_pass').focus();}catch(e){}
if(typeof wpOnload=='function')wpOnload();
</script>

<link rel="stylesheet" id="llar-login-page-styles-css" href="http://mysitefortest.xyz/wp-content/plugins/limit-login-attempts-reloaded/assets/css/login-page-styles.css?ver=2.23.1" type="text/css" media="all">

<div class="clear"></div>

</body>
</html>
